import React from 'react';
import { Link } from 'react-router-dom';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import '../styles/Home.css';

const Home = () => {
  // VÃ©rification des chemins des images
  console.log("Image URL 1:", `${process.env.PUBLIC_URL}/caroussel/moderne.jpeg`);
  console.log("Image URL 2:", `${process.env.PUBLIC_URL}/caroussel/style.jpeg`);
  console.log("Image URL 3:", `${process.env.PUBLIC_URL}/caroussel/traditionnel.jpeg`);

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  return (
    <div className="home-container">
      {/* ðŸ”¹ Header */}
      <header className="header">
        <nav className="navbar">
          <div className="logo">
            <img src="https://cdn-icons-png.flaticon.com/128/892/892634.png" alt="Logo" />
          </div>
          <ul className="nav-links">
            <li><Link to="/">Accueil</Link></li>
            <li><Link to="/shop">Shop</Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>
          <div className="right-icons">
            <a href="https://instagram.com" target="_blank" rel="noopener noreferrer">
              <img src="https://cdn-icons-png.flaticon.com/128/2111/2111463.png" alt="Instagram" />
            </a>
            <div className="whatsapp">
              <img src="https://cdn-icons-png.flaticon.com/128/3536/3536445.png" alt="WhatsApp" />
              <span>+212 6 XX XX XX XX</span>
            </div>
            <img src="https://cdn-icons-png.flaticon.com/128/3135/3135715.png" alt="Profil" className="profile-icon" />
          </div>
        </nav>
      </header>

      {/* ðŸ”¹ Carrousel */}
      <div className="carousel-container">
        <Slider {...settings}>
          <div>
            <img src={`${process.env.PUBLIC_URL}/caroussel/moderne.jpeg`} alt="Moderne" />
          </div>
          <div>
            <img src={`${process.env.PUBLIC_URL}/caroussel/style.jpeg`} alt="Style" />
          </div>
          <div>
            <img src={`${process.env.PUBLIC_URL}/caroussel/traditionnel.jpeg`} alt="Traditionnel" />
          </div>
        </Slider>
      </div>

      {/* ðŸ”¹ Section des 6 images */}
      <div className="image-grid">
        {[1, 2, 3, 4, 5, 6].map((num) => (
          <div className="image-box" key={num}>
            <img src={`${process.env.PUBLIC_URL}/affiche/affiche${num}.jpeg`} alt={`Affiche ${num}`} />
          </div>
        ))}
      </div>

      {/* ðŸ”¹ Footer */}
      <footer className="footer">
        <p>Â© 2025 Tadlaoui Shop - Tous droits rÃ©servÃ©s.</p>
      </footer>
    </div>
  );
};

export default Home;
